import React from "react"
import {
NavLink,
Route
}
 from "react-router-dom";
 import {ButtonContainer} from "./Button"

function LearnCourse ({match}){
return( 
	<div> 



 	<NavLink to={`${match.url}/Mathematics/Algebra`}>Algebra>
						<ButtonContainer onClick={(<Route path={`${match.path}/:name`} render= {({match})=>(
	<div> 
  	<h3> {match.params.name} </h3>
  	</div>
  	)}/>)}>
						LEARN COURSE
						</ButtonContainer>
						</NavLink>





 		<p>Title</p>

 		<div class="button"><NavLink to="/members">SEARCH A MENTOR</NavLink></div>
 		<div class="button"><NavLink to="/allgroups">SEARCH A GROUP</NavLink></div>
  	</div>
  )
}


export default LearnCourse
